	var result =  _.extend({}, source);
	var data =  result.rows;

	//Add Bollinger Bands

	result.columns.push('bolMean');
	result.columns.push('bolHigh');
	result.columns.push('bolLow');
	result.meta['bolMean'] = 9;
	result.meta['bolHigh'] = 9;
	result.meta['bolLow'] = 9;

	var n = 20; 
    var k = 2;
	var bands = []; //{ ma: 0, low: 0, high: 0 }
    for (var i = n - 1, len = data.length; i < len; i++) {
        var slice = data.slice(i + 1 - n , i);
	    var mean =  _.meanBy(slice, function(d) { return parseFloat(d.Close); });
	    var stdDev = Math.sqrt(_.meanBy(slice, function(d) { return  Math.pow(parseFloat(d.Close) - mean, 2); }));

        result.rows[i]['bolMean'] =  mean;
        result.rows[i]['bolLow'] =  mean - (k * stdDev);
        result.rows[i]['bolHigh'] =   mean + (k * stdDev);

    }	
    callback(result);

}

